(987, '20', 'point4', 'Duplicate \"Guardian email & Guardian Phone\" rows will not be imported. Guardian email & Guardian Phone used or not you can get from student report page search on class & section', 'No se importarán filas duplicadas de \"Guardian email & Guardian Phone\". El correo electrónico de Guardian & Guardian Phone utilizado o no se puede obtener de la página de informe del alumno en la clase y sección', 'সদৃশ \"অভিভাবক ইমেল এবং গার্ডিয়ান ফোন\" সারিগুলি আমদানি করা হবে না। অভিভাবক ইমেল এবং গার্ডিয়ান ফোন ব্যবহৃত বা না আপনি ক্লাস ও বিভাগে শিক্ষার্থীর প্রতিবেদন পৃষ্ঠা সন্ধান থেকে পেতে পারেন', 'Les lignes dupliquées \"Email et téléphone Guardian\" ne seront pas importées. Guardian email & Guardian Phone utilisé ou non, vous pouvez obtenir une recherche dans la page de rapport de létudiant sur la classe et la section', 1, '2023-06-04 02:35:29', '2023-06-04 02:35:29', 1),
(988, '20', 'point5', 'For student Session use Id', 'Para el estudiante Sesión use Id', 'শিক্ষার্থীদের সেশনের জন্য আইডি ব্যবহার করুন', 'Pour les étudiants \"Session\", utilisez lidentifiant', 1, '2023-06-04 02:35:29', '2023-06-04 02:35:29', 1),
