(990, '20', 'point7', 'For student \"Blood Group\" use Id', 'Para el estudiante \"Grupo de sangre\" use ID', 'শিক্ষার্থীদের জন্য \"ব্লাড গ্রুপ\" আইডি ব্যবহার করুন', 'Pour les étudiants Groupe sanguin, utilisez lId', 1, '2023-06-04 02:35:29', '2023-06-04 02:35:29', 1),
