(992, '20', 'point9', 'For student \"Guardian Relation\" use capital O for Other, F for Father M for Mother.', 'Para el estudiante \"Guardian Relation\" use mayúscula O para Otro, F para el Padre M para la Madre.', 'শিক্ষার্থীর জন্য \"গার্ডিয়ান রিলেশন\" অন্যের জন্য মূলধন ও ব্যবহার করুন, মায়ের জন্য এফ ফাদার এম।', 'Pour les étudiants \"Relation Gardien\", utilisez la majuscule O pour Autre, F pour Père M pour Mère.', 1, '2023-06-04 02:35:29', '2023-06-04 02:35:29', 1),
